import React, { useState } from 'react';
import axios from 'axios';
import './signup-student.css'; // Import the CSS file

const SignupStudent = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [departments, setDepartments] = useState([]);
  const [years, setYears] = useState([]);
  const [error, setError] = useState('');
  const [isSignedUp, setIsSignedUp] = useState(false);

  const handleSignup = async () => {
    try {
      const response = await axios.post('http://localhost:4000/signup-student', { email, password, departments, years });
      console.log('Response:', response);
      setIsSignedUp(true);
    } catch (error) {
      console.error('Error:', error);
      setError(error.response?.data?.message || 'An error occurred');
    }
  };

  if (isSignedUp) {
    window.location.href = '/';
  }

  return (
    <div>
      <h1>Signup</h1>
      <div >
        <input
          type="text"
          placeholder=" "
          value={email}
          onChange={(e) => setEmail(e.target.value)}
          className="input-field"
        />
      </div>
      <div>
        <input
          type="password"
          placeholder=" "
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          className="input-field"
        />
      </div>
      <div>
        <label>Select Department(s):</label>
        <div>
          <input
            type="checkbox"
            value="IT"
            onChange={(e) => setDepartments([...departments, e.target.value])}
          />
          <label>IT</label>
        </div>
        <div>
          <input
            type="checkbox"
            value="CSE"
            onChange={(e) => setDepartments([...departments, e.target.value])}
          />
          <label>CSE</label>
        </div>
        <div>
          <input
            type="checkbox"
            value="ECE"
            onChange={(e) => setDepartments([...departments, e.target.value])}
          />
          <label>ECE</label>
        </div>
        <div>
          <input
            type="checkbox"
            value="EEE"
            onChange={(e) => setDepartments([...departments, e.target.value])}
          />
          <label>EEE</label>
        </div>
        <div>
          <input
            type="checkbox"
            value="MECH"
            onChange={(e) => setDepartments([...departments, e.target.value])}
          />
          <label>MECH</label>
        </div>
        <div>
          <input
            type="checkbox"
            value="AI&DS"
            onChange={(e) => setDepartments([...departments, e.target.value])}
          />
          <label>AI&DS</label>
        </div>
        {/* Add more departments as needed */}
      </div>
      <div>
        <label>Select Year(s):</label>
        <div>
          <input
            type="checkbox"
            value="1"
            onChange={(e) => setYears([...years, e.target.value])}
          />
          <label>1</label>
        </div>
        <div>
          <input
            type="checkbox"
            value="2"
            onChange={(e) => setYears([...years, e.target.value])}
          />
          <label>2</label>
        </div>
        <div>
          <input
            type="checkbox"
            value="3"
            onChange={(e) => setYears([...years, e.target.value])}
          />
          <label>3</label>
        </div>
        <div>
          <input
            type="checkbox"
            value="4"
            onChange={(e) => setYears([...years, e.target.value])}
          />
          <label>4</label>
        </div>
        {/* Add more years as needed */}
      </div>
      <button onClick={handleSignup}>Signup</button>
      {error && <p className="error-message">{error}</p>}
    </div>
  );
};

export default SignupStudent;
